import React from 'react';
import { motion } from 'framer-motion';
import { BarChart3, Calendar, MessageCircle, TrendingUp, Users, Zap } from 'lucide-react';

const Solutions: React.FC = () => {
  const solutions = [
    {
      icon: Calendar,
      title: "방막기 자동화",
      description: "여러 OTA 사이트의 예약을 한 번에 확인하고 자동으로 방막기 처리",
      benefit: "하루 2시간 절약",
      color: "text-blue-500"
    },
    {
      icon: TrendingUp,
      title: "가격 최적화",
      description: "주변 숙소 가격을 실시간 분석하여 최적 가격을 추천",
      benefit: "매출 20% 증가",
      color: "text-green-500"
    },
    {
      icon: MessageCircle,
      title: "자동 메시지",
      description: "체크인 안내, 리뷰 요청 등을 자동으로 발송",
      benefit: "고객 만족도 향상",
      color: "text-purple-500"
    },
    {
      icon: BarChart3,
      title: "매출 분석",
      description: "실시간 매출 현황과 수익성을 한눈에 파악",
      benefit: "데이터 기반 의사결정",
      color: "text-orange-500"
    },
    {
      icon: Users,
      title: "마케팅 도구",
      description: "SNS 마케팅부터 인플루언서 매칭까지 모든 마케팅 지원",
      benefit: "예약률 30% 향상",
      color: "text-indigo-500"
    },
    {
      icon: Zap,
      title: "통합 관리",
      description: "예약부터 정산까지 모든 과정을 체계적으로 관리",
      benefit: "운영 효율성 극대화",
      color: "text-red-500"
    }
  ];

  return (
    <section id="solutions" className="py-20 bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-16">
          <motion.h2
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
            className="text-3xl md:text-4xl font-bold text-gray-900 mb-4"
          >
            모든 문제를 한 번에 해결하는 솔루션
          </motion.h2>
          <motion.p
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            viewport={{ once: true }}
            className="text-xl text-gray-600 max-w-3xl mx-auto"
          >
            복잡한 기술 용어 없이, 실제로 필요한 결과만을 제공합니다
          </motion.p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {solutions.map((solution, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              className="bg-white rounded-2xl p-8 shadow-lg hover:shadow-xl transition-shadow duration-200 group"
            >
              <div className="flex items-center justify-center w-16 h-16 bg-gray-50 rounded-xl mb-6 group-hover:bg-gray-100 transition-colors">
                <solution.icon className={`${solution.color} w-8 h-8`} />
              </div>

              <h3 className="text-xl font-bold text-gray-900 mb-3">
                {solution.title}
              </h3>

              <p className="text-gray-600 mb-4 leading-relaxed">
                {solution.description}
              </p>

              <div className="inline-flex items-center px-3 py-1 bg-green-100 text-green-800 text-sm font-medium rounded-full">
                {solution.benefit}
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.6 }}
          viewport={{ once: true }}
          className="text-center mt-16 p-8 bg-white rounded-2xl shadow-lg"
        >
          <h3 className="text-2xl font-bold text-gray-900 mb-4">
            이제 혼자 운영해도 충분합니다
          </h3>
          <p className="text-lg text-gray-600 mb-6">
            복잡한 시스템 없이도 전문가처럼 숙소를 운영할 수 있습니다
          </p>
          <div className="flex flex-col sm:flex-row gap-4 justify-center">
            <button className="btn-primary">
              무료로 시작하기
            </button>
            <button className="btn-secondary">
              데모 체험하기
            </button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Solutions;
